import React, { Component } from 'react'
import AtomSpinner from '@bit/bondz.react-epic-spinners.atom-spinner'

import './App.css';

class Header extends Component {
  render() {
    return (
      <div>
        <header className="App-header">
          <AtomSpinner
            size='200'
            color='#fffff'
          />
        </header>
        This is the header.
      </div>
    )
  }
}

export default Header
